import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'


/**
 * 
 */
const footerMain = {
    backgroundColor: "black",
    padding: "3em",
    color: "#02FFFF",
    position: "absolute",
    width: "100%",
    bottom: "0",
    display: "flex",
    justifyContent: "center",
    fontFamily: "sans-serif"
}

const Footer = () => {
    return <footer style={footerMain}>
        <i className="material-icons" style={{ fontSize: '36px' }}>share</i>
        <img src="https://img.icons8.com/small/32/000000/linkedin.png" />
        <i style={{ fontFamily: "sans-serif" }}>IN</i>
    </footer>;
}


// #endregion

export default Footer;
